|armiger = [[Senegal|Republic of Senegal]] |year_adopted = 1960s |crest = A [[mullet (heraldry)|mullet]] [[vert]]. |shield = Parted per pale, the first Gules a lion rampant Or, the second Or, a baobab-tree proper and in base a fess wavy Vert (at nombril point) |motto = {{lang-fr|UN PEUPLE UN BUT UNE FOI}} |orders = The star of the Ordre National du Lion ([[Legion of Honor]]) |other_elements = The arms are surrounded by a two palm-leaves Argent, a white ribbon Garland bearing the motto is wrapped. |earlier_versions = |use = }}
The '''coat of arms of Senegal''' dates from the 1960s and reads ''Un Peuple Un But Une Foi''--''One People, One Goal, One Faith'' in the [[French language]]. It bears the [[Pan-African colours]] and the green star from the [[flag of Senegal]].
